Frankrijk
Actie / Misdaad
92 minuten

een zeer goeie film

met John Travolta, Jonathan Rhys Meyers en Kasia Smutniak

James Reece, assistent van de Britse ambassadeur in Parijs heeft de ambitie te slagen bij de geheime dienst. Hij krijgt zijn 
kans wanneer hij de opdracht krijgt samen te werken met de Amerikaanse CIA-agent Charlie Wax om een terroristische aanslag in 
Parijs te voorkomen. Charlie Wax is echter een loose canon die de stad binnen de kortste keren op z'n kop zet en Reece als zijn 
chauffeur behandelt.
